CREATE TABLE `mppres` (
  `mpre_id` varchar(20) NOT NULL,
  `id` varchar(15) NOT NULL,
  `numero` decimal(10,0) NOT NULL,
  `numegrup` decimal(10,0) DEFAULT NULL,
  `descri` text,
  `idband` varchar(2) DEFAULT NULL,
  `porcgad` decimal(10,2) DEFAULT NULL,
  `porcpre` decimal(12,2) DEFAULT NULL,
  `porcutil` decimal(12,2) DEFAULT NULL,
