  `rendimi` decimal(12,2) DEFAULT NULL,
  `unidad` varchar(6) DEFAULT NULL,
  `redondeo` varchar(1) DEFAULT NULL,
  `status` varchar(1) DEFAULT NULL,
  `cantidad` decimal(10,2) DEFAULT NULL,
  `tipo` varchar(10) NOT NULL,
  `nropresupuesto` decimal(10,0) DEFAULT '0',
  `nrocuadro` int(10) unsigned DEFAULT NULL,
  `mppre_id` varchar(20) DEFAULT NULL,
  `tiporec` varchar(10) DEFAULT NULL,
  `refere` varchar(45) DEFAULT NULL,
