CREATE TABLE `mptabs` (
  `codicove` varchar(15) NOT NULL DEFAULT '',
  `numero` decimal(10,0) NOT NULL,
  `numegrup` decimal(10,0) NOT NULL DEFAULT '0',
  `descri` text,
  `refere` varchar(30) DEFAULT NULL,
  `mbdat_id` varchar(2) NOT NULL DEFAULT '',
  `porcgad` decimal(10,2) DEFAULT NULL,
  `porcpre` decimal(12,2) DEFAULT NULL,
  `porcutil` decimal(12,2) DEFAULT NULL,
  `precasu` decimal(12,2) DEFAULT NULL,
  `precunit` decimal(12,2) DEFAULT NULL,
  `rendimi` decimal(12,2) DEFAULT NULL,
  `unidad` varchar(6) DEFAULT NULL,
  `redondeo` varchar(1) NOT NULL DEFAULT '0',
  `status` varchar(1) DEFAULT NULL,
  `mtabus_id` varchar(20) NOT NULL,
  `cantidad` decimal(10,0) DEFAULT NULL,
  `capitulo` int(10) unsigned DEFAULT NULL,
  `numenletra` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`numero`,`mtabus_id`,`codicove`),
  KEY `FK_mptabs_mtabus` (`mtabus_id`)
